// SPDX-License-Identifier: MIT
pragma solidity ^0.7;

import "./vendor/access/AccessControl.sol";

interface IERC20Ops {
    function mint(address, uint256) external;
    function burnFrom(address, uint256) external;
}

contract TokenSwap is AccessControl {
    
    bytes32 public constant WHITELISTED = keccak256("WHITELISTED");
    
    address public oldToken;
    address public newToken;
    
    constructor(address _oldToken, address _newToken){
        oldToken = _oldToken;
        newToken = _newToken;
        _setupRole(DEFAULT_ADMIN_ROLE, _msgSender());
        _setupRole(WHITELISTED, _msgSender());
    }
    
    function whitelisted(address addr) public view returns (bool) {
        return hasRole(WHITELISTED, addr);
    } 
    
    function whitelistAdd(address[] memory addrs) public {
        require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()), "Caller is not admin");
        for (uint256 i = 0; i < addrs.length; i++){
            grantRole(WHITELISTED, addrs[i]);
        }
    }
    
    function whitelistRemove(address[] memory addrs) public {
        require(hasRole(DEFAULT_ADMIN_ROLE, _msgSender()), "Caller is not admin");
        for (uint256 i = 0; i < addrs.length; i++){
            revokeRole(WHITELISTED, addrs[i]);
        }
    }
    
    function swap(uint256 val) public {
        require(hasRole(WHITELISTED, _msgSender()), "Caller is not whitelisted");
        IERC20Ops(oldToken).burnFrom(_msgSender(), val);
        IERC20Ops(newToken).mint(_msgSender(), val);
    }
    
}
